import styles from'./App.module.css'

function App() {
  return (
    <div className={styles.App}>
      <Job className={styles.job}  name='Usama'/>
    </div>
  );
}


const Job = (props) => {
  return (
    <div>
      <p>{props.name}</p>
    </div>
  )
}


export default App;
